import optionalNodeCollectionValidator from "../validators/optionalNodeCollection.finder.validator.js";
/**
 * Finds undeclared export
 *
 * @example
 * ```
 * export {
 *   example
 * }
 * ```
 */
export default function exportFinder(jcs, collection) {
    return optionalNodeCollectionValidator(collection.find(jcs.ExportNamedDeclaration, { declaration: null }), "ExportNamedCollection");
}
